import React, { useState } from 'react';
import { BrowserRouter as Router, Link, Switch, Route } from 'react-router-dom';

import Footer from './components/footer';

import Home from './Pages/home';

function App() {
	return (
		<Router>
			<Route path='/' exact component={Home} />
			<Footer />
		</Router>
	);
}

export default App;
